Defendant Yvonne L Zindler in court, in custody, with attorney Katie B Bricco.   Abbey Nickolie appeared for the State of Wisconsin.  The Defendant enters a plea of guilty to Count #1. The Court finds the Defendant guilty of the charge.  Count #2 of the amended information is dismissed by operation of law. The Defendant was sentenced to the following:

IMPOSED SENTENCE of: 

6 YEARS IMPRISONMENT (CREDIT - 93 days)
  -  2 YEAR(S) OF INITIAL CONFINEMENT
  -  4 YEAR(S) OF EXTENDED SUPERVISION;

CONDITIONS OF EXTENDED SUPERVISION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety;  Random U.A.'s ; 
*No Use or Possession of alcohol, controlled substances or drug paraphernalia.
*No Use or Possession of prescription drugs without a valid prescription;
*Any valid prescription drugs must be taken only in the manner in which they are prescribed.
*Inform Agent of all prescriptions
*Follow through with any treatment and/or counseling recommended by Agent;
*Use only one pharmacy;
*Not to operate a motor vehicle unless properly licensed;
*DNA sample to be provided if not yet previously done.
*DNA surcharge $250.00.
*No association with known drug users or dealers and no contact at any place where illegal drugs are purchased, used, stored, packaged, or distributed.
*No presence on any premises whose primary business is serving or selling alcohol (i.e bars, taverns, or liquor stores).
*Psychological evaluation and treatment deemed appropriate.
*Attend Victim Impact Panel;
FINE :  $2277.00 (to be paid as a condition of extended supervision);
DNA SURCHARGE:  $250.00 (to be paid as a condition of extended supervision);
BLOOD DRAW FEE:  $35.00 paid through Waukesha County Circuit Court to be forward to City of Waukesha Police Department or to be converted to a civil judgment for non payment of fee.
TRANSCRIPT FEE:  $22.00 paid through Waukesha County Circuit Court to be forward to District Attorney or to be converted to a civil judgment for non payment of fee.
DL REVOCATION: 4 YEARS;
IGNITION INTERLOCK: 4 YEARS;

Defendant is not eligible for Challenge Incarceration Program.
Defendant is eligible for Substance Abuse Program.

Felony warnings, voting rights and firearms warnings given.
